"use strict";
var tid = setInterval(function() {
    if ("complete" === document.readyState) {
        clearInterval(tid);
        var e = document.querySelector.bind(document),
            t = document.querySelector(".vertical_nav"),
            n = document.querySelector(".wrapper"),
            s = document.getElementById("js-menu"),
            l = s.querySelectorAll(".menu--item__has_sub_menu");
        e(".toggle_menu").onclick = function() {
            t.classList.toggle("vertical_nav__opened"), n.classList.toggle("toggle-content")
        }, e(".collapse_menu").onclick = function() {
            t.classList.toggle("vertical_nav__minify"), n.classList.toggle("wrapper__minify");
            for (var e = 0; e < l.length; e++) l[e].classList.remove("menu--subitens__opened")
        };
        for (var o = 0; o < l.length; o++) l[o].classList.contains("menu--item__has_sub_menu") && l[o].querySelector(".menu--link").addEventListener("click", function(e) {
            for (var t = 0; t < l.length; t++) e.target.offsetParent != l[t] && l[t].classList.remove("menu--subitens__opened");
            e.target.offsetParent.classList.toggle("menu--subitens__opened")
        }, !1)
    }
}, 100);